-compile({nowarn_unused_function,merge_msg_Emission/3}).
merge_msg_Emission(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
      {_, #{amount := NFamount}} -> S1#{amount => NFamount};
      {#{amount := PFamount}, _} -> S1#{amount => PFamount};
